/* Shop Components */
import React from "react";
import { Route } from 'react-router-dom';
import CollcetionsOverview from '../../components/collections-overview/collections-overview.component';

const ShopPage = ({ match }) => (
      <div className='shop-page'>
        <Route exact path={`${match.path}`} component={CollcetionsOverview} />
      </div>
      );

export default ShopPage;
